import React, { Component } from 'react';
import Navbar from './components/navbar';
import {Route, Switch} from 'react-router-dom';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Switch>
          <Route path="/" component={Navbar} />
        </Switch>
      </div>
    );
  }
}

export default App;
